DROP DATABASE IF EXISTS DBMEGASENA;
CREATE DATABASE DBMEGASENA;
USE DBMEGASENA;

CREATE TABLE SORTEIO(
	IDSORTEIO INT NOT NULL PRIMARY KEY
	, NUMCONCURSO INT
	, DTCONCURSO DATE
	, VALOR_ARRECADADO NUMERIC(14,2)
	, QTDE_GANHADORES_SENA INT
	, VALOR_PREMIO_SENA NUMERIC(14,2)
	, QTDE_GANHADORES_QUINA INT
	, VALOR_PREMIO_QUINA NUMERIC(14,2)
	, QTDE_GANHADORES_QUADRA INT
	, VALOR_PREMIO_QUADRA NUMERIC(14,2)
	, CONCURSO_ACUMULADO ENUM('S', 'N')
	, VALOR_ACUMULADO NUMERIC(14,2)
	, DEZENA_1 INT
	, DEZENA_2 INT
	, DEZENA_3 INT
	, DEZENA_4 INT
	, DEZENA_5 INT
	, DEZENA_6 INT
);

CREATE TABLE NUMEROSORTEADO(
	IDNUMEROSORTEADO INT NOT NULL PRIMARY KEY AUTO_INCREMENT
	, NUMCONCURSO INT
	, ORDEM INT
	, DEZENA INT
);



